import styled from "styled-components";

export const FooterBottom=styled.div`
padding: 33px 0px;
border: 1px solid black;
margin-bottom: 19px;
display: flex;
align-items: center;
justify-content: space-between;
flex-direction: row;
`
export const Left=styled.div`
font-family: Rubik;
font-style: normal;
font-weight: normal;
font-size: 14px;
line-height: 14px;
color: #555555;
`
